import React from "react";
import Nav from "./components/nav/Nav";
import NavLink from "./components/nav/navlink/NavLink";
import Input from "./components/form/Input";
import Form from "./components/form/Form";
import Container from "./components/container/Container";
import Body from "./components/body/Body";
import Content from "./components/content/Content";
import Header from "./components/header/Header";
import Login from "./components/header/login/Login";

import logo from "./assets/img/logo.png";

import FullCalendar from '@fullcalendar/react' // must go before plugins
import dayGridPlugin from '@fullcalendar/daygrid' // a plugin!

function App() {
  return (
    <Container>
      <Header>
        {" "}
        <img
          src={logo}
          alt="logo"
          style={{ height: "3.25rem", marginLeft: "2rem" }}
        />
        <Form>
          {" "}
          <Input placeholder="Search by anything..." />
        </Form>
        <Login />
      </Header>
      <Body>
        {" "}
        <Nav>
          {" "}
          <NavLink href="">Project_test</NavLink>
          <NavLink href="/tasks">Task_test</NavLink>
          <NavLink href="">User_test</NavLink>
        </Nav>
        <Content>
        <FullCalendar plugins={[ dayGridPlugin ]} initialView="dayGridMonth" weekends={false}
          events={[ { title: 'Ting-Yeh Birthday', date: '2021-10-08' },   
                    { title: 'Study Week Start', date: '2021-10-24' }
          ]}
        />
        </Content>
      </Body>
    </Container>
  );
}

export default App;
